class SolutionA:
    def lengthOfLongestSubstring(self, s: str) -> int:
        maxSize = 0
        for i in range(0, len(s)):
            for j in range(i, len(s)):
                substr = []
                for c in s[i:j+1]:
                    if c in substr:
                        break
                    substr.append(c)
                    maxSize = max(maxSize, len(substr))
                substr = None

        return maxSize


